"      <a class=\"medical medical_basics\" href=\"UTD.htm?21/25/21906?source=see_link\">",
"       Patient information: Genital herpes (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?25/41/26258?source=see_link\">",
"       Patient information: Hepatitis B (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?5/22/5475?source=see_link\">",
"       Patient information: Human papillomavirus (HPV) vaccine (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?13/56/14211?source=see_link\">",
"       Patient information: Choosing birth control (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?35/8/35973?source=see_link\">",
"       Patient information: Adolescent sexuality (Beyond the Basics)",
"      </a>",
"     </p>",
