var title_f1_21_1372="Effect of anticholinergics";
var content_f1_21_1372=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F53819&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F53819&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Effect of anticholinergics on airways hyperresponsiveness in asthma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Provocation",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"1\">",
"        Effect of anticholinergic on responsiveness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prostaglandin D(2)",
"       </td>",
"       <td>",
"        12 to 22-fold increase in PC(20)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thromboxane A(2)",
"       </td>",
"       <td>",
"        23-fold increase in PC(20)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bradykinin",
"       </td>",
"       <td>",
"        5-fold increase in PD(35)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Histamine",
"       </td>",
"       <td>",
"        10-fold increase in PC(100)SRaw",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Capsaicin",
"       </td>",
"       <td>",
"        PC 60 percent",
"reduction in response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Distilled water",
"       </td>",
"       <td colspan=\"1\">",
"        50 - 100 percent reduction in response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Beta",
"blockers",
"       </td>",
"       <td>",
"        Abolished",
"response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperpnea",
"       </td>",
"       <td>",
"        Abolished response in children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Psychogenic stimulation",
"       </td>",
"       <td>",
"        Abolished response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Exercise",
"       </td>",
"       <td>",
"        30 percent",
"reduction in response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reflux/esophageal",
"acidification",
"       </td>",
"       <td>",
"        Abolished response",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     Anticholinergics used were either ipratropium bromide or atropine delivered via aerosol.",
"     <br>",
"      PC(20) and PD(35): provocative concentration (or dose) of agonist producing a 20 or 35 percent fall in forced expiratory volume in 1 second (FEV(1)).",
"      <br>",
"       PC(100)SRaw: provocative concentration of agonist producing a 100 percent increase in specific airways resistance.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
